&lt;p&gt;&lt;strong&gt;Sentences of a paragraph are given below in jumbled order. Arrange the sentences in the right order to form a meaningful and coherent paragraph.&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;A. At its height, around 1,200 years ago, the city of Calakmul had a population of about 50,000 people, but the kingdom as a whole numbered more than 1.5 million.&lt;/p&gt;

&lt;p&gt;B. Deep in the jungle of southern Mexico lie the ruins of a city that thrived for centuries before it was abandoned more than 1,000 years ago.&lt;/p&gt;

&lt;p&gt;C. Archaeologists have uncovered 6,750 structures here-the largest is this pyramid temple, called, simply, &amp;#39;Structure 2.&amp;#39;&lt;/p&gt;

&lt;p&gt;D. Calakmul was once one of the two duelling superpowers-along with Tikal-of the Classical Mayan civilisation.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Sentences of a paragraph are given below in jumbled order. Arrange the sentences in the right order to form a meaningful and coherent paragraph.&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;A. &amp;ldquo;I have already spent it,&amp;rdquo; the thief replied.&lt;/p&gt;

&lt;p&gt;B. &amp;ldquo;What! I will take you to the police right now,&amp;rdquo; Arun thundered.&lt;/p&gt;

&lt;p&gt;C. &amp;ldquo;Give me back my money,&amp;rdquo; Arun said to the thief.&lt;/p&gt;

&lt;p&gt;D. &amp;ldquo;Sir, please have some mercy on me,&amp;rdquo; the thief pleaded.&lt;/p&gt;
